sort an array of 2,000,000 unique elements in random order 
on the same computer? 



public static void sort(int[] data) { 
  int[] temp = new int[data.length]; 
  sort(data, temp, 0, data.length - 1); 
} 

public static void sort(int[] data,  
int[] temp, int i, int j){

  if( i < j){ 
    int m = (i + j) / 2; 
    sort(data, temp, i, m); 
    sort(data, temp, m + 1, j); 

    int le = m; 
    int tp = i; 
    int ne = j - i + 1; 
    while( i <= le && m + 1 <= j){ 
      if( data[i] <= data[m + 1] ){ 
        temp[ tp ] = data[ i ]; 
        i++; 
      } 
      else{ 
        temp[tp] = data[m + 1]; 
        m++; 
      } 
      tp++; 
    } 

    while( i <= le){ 
      temp[ tp ] = data[ i ]; 
      tp++; 
      i++;                       
    } 

    while( m + 1 <= j){ 
      temp[ tp ] = data[ m + 1 ]; 
      tp++; 
      m++;                        
    } 

    for(int k = 0; k < ne; k++){ 
      data[ j ] = temp[ j ]; 
      j--; 
    } 
  } 
}

