public class Node{ 
  public String val; 
  public Node ft; 
  public Node rt; 
} 
------------------------------------------ 
public class Structure{ 

  private Node n; 

  public void add(String s){ 
    n = add(s, n); 
  } 

  private Node add(String s, Node n){ 
    if( n == null ){ 
      n = new Node(); 
      n.val = s; 
    } 
    int c = n.val.compareTo( s ); 
    if( c < 0 ) 
      n.rt = add(s, n.rt); 
    else if( c > 0 ) 
      n.ft = add( s, n.ft); 
    return n; 
  } 

  public void show(){ 
    show(n); 
  } 

  private void show(Node n){ 
    if( n != null ){ 
      show(n.ft); 
      show(n.rt); 
      System.out.print( n.val ); 
    } 
  } 

  public int ct(){  
    return ct(n);  
  } 

  private int ct(Node n){ 
    int res = 0; 
    if( n != null ) { 
      if( n.ft == null && n.rt == null ) 
        res = 1; 
      else  
        res = ct(n.ft) + ct(n.rt); 
    } 
    return res; 
  } 

}

