/* pre: list != null, list.length > 0,  
   list is sorted in ascending order. 
*/ 
public static int myst(int[] lt, int tgt){ 

  int len = lt.length; 
  if( tgt < lt[0] || tgt > lt[len - 1] ) 
    return -1; 

  int pos = tgt - lt[0]; 
  pos *= len - 1; 
  pos /= lt[len - 1] - lt[0]; 
  int inc = lt[pos] < tgt ? 1 : -1; 

  while( pos >= 0 && pos < len &&  
lt[pos] != tgt){ 
      pos += inc; 
  } 

  pos = (pos == len) ? -1 : pos; 
  return pos; 
}

