public class Structure2{ 

  private ArrayList<*1> myCon; 

  //pre: h > 0 
  public Structure2(int h){ 
    myCon = new ArrayList<*1>(); 
    for(int i = 0; i <= h; i++) 
      myCon.add( new ArrayList<String>() );
  } 

  //pre: 0 <= val <= high() 
  public void add(String s, int val){ 
    myCon.get(val).add(s); 
  } 

  public boolean isEmpty(){ 
    boolean e = true; 
    int i = 0; 
    while( e && i <= high() ){ 
      e = myCon.get(i).size() == 0; 
      i++; 
    } 
    return e; 
  } 

  // pre: !isEmpty() 
  public String remove(){ 
    return helper(0);   
  } 

  // pre: !isEmpty() 
  public String get(){ 
    return helper(1); 
  } 

  private String helper(int op){ 
    int i = 0; 
    boolean done = false; 
    String result = ""; 
    while( !done && i <= high() ){ 
      if( myCon.get(i).size() != 0 ){ 
        done = true; 
        if( op == 0 ) 
          result = myCon.get(i).remove(0); 
        else 
          result = myCon.get(i).get(0); 
      } 
      else 
        i++; 
     } 
     return result; 
  } 

  public int high(){ 
    return myCon.size() - 1; 
  } 
}
